mapper.select:

select DEPOSIT_ID, DEPOSIT_TYPE, CUST_ID, SUPPLIER_ID, ORDER_NO, SERIAL_NO, ORDER_AMT, 
ORDER_SOURCE, ADD_TIME, EFFECTY_TIME, DEPOSIT_STATUS, REFUND_NO, REFUND_TIME, REFUND_AMT, 
REFUND_DESC, BROKER_AMT, ILLEGAL_AMT
from clzah_bussiness_depoist_base


     AND DEPOSIT_TYPE = #{depositType,jdbcType=TINYINT}


     AND CUST_ID = #{custId,jdbcType=CHAR}


     AND SUPPLIER_ID = #{supplierId,jdbcType=CHAR}


     AND ORDER_NO = #{orderNo,jdbcType=VARCHAR}


     AND SERIAL_NO = #{serialNo,jdbcType=VARCHAR}


     AND ORDER_AMT = #{orderAmt,jdbcType=DOUBLE}


     AND ORDER_SOURCE = #{orderSource,jdbcType=TINYINT}


     AND ADD_TIME = #{addTime,jdbcType=TIMESTAMP}


     AND EFFECTY_TIME = #{effectyTime,jdbcType=TIMESTAMP}


     AND DEPOSIT_STATUS = #{depositStatus,jdbcType=TINYINT}


     AND REFUND_NO = #{refundNo,jdbcType=VARCHAR}


     AND REFUND_TIME = #{refundTime,jdbcType=TIMESTAMP}


     AND REFUND_AMT = #{refundAmt,jdbcType=DOUBLE}


     AND REFUND_DESC = #{refundDesc,jdbcType=VARCHAR}


     AND BROKER_AMT = #{brokerAmt,jdbcType=DOUBLE}


     AND ILLEGAL_AMT = #{illegalAmt,jdbcType=DOUBLE}
